import { useState } from 'react';
import './App.css';
import {getSurveydto} from './api';
function App() {

    //const [state, setState] = useState("");
    const [surveydto, setSurveydto] = useState({surveyId:null, fixed_entry:null})

    function handleClickSurvey(){
        getSurveyDTO().then(response => {
            console.log(response);
            setSurveyDTO(response);
        })
    }
    return (
        <div>
            <button onClick={handleClickSurvey}>SurveyDTO</button>
            <p>
                surveyId: {surveydto.surveyId}<br/>
                fixed_entry: {surveydto.fixed_entry}
            </p>
        </div>
    );
}

export default App;
